import {Bar} from 'react-chartjs-2'
import Select from 'react-select'
// import { Link } from "react-router-dom";




function ClickCountButton2(data1) {
    console.log("data 1 is ", data1.labels)
    const [count, setCount] = useState(0);
    const [data12, setData] = useState({})
    console.log("default val ", data12)
    var graphData = data1
    if (Object.keys(data12).length > 0) {
        console.log("hit if statement")
        graphData = data12
    }

    var partylist = [
        {
            value:1,
            label:"Democrat"
        },
        {
            value:2,
            label:"Republican"
        }
]

    return (
        <>
        <div className='bar-chart'>
             <Bar
            data = {{
                labels:graphData.labels,
                datasets: [{
                    label: '# of votesk',
                    data: graphData.averages
                }
                ]
            }}
            height={400}
            width={600}
            />


        </div>
        <div>
            <div className={`load-button`} onClick={() => WhoKnows("ok")}>
        <p style={{ paddingTop:'18px' }}>Load</p>
        </div>

        </div>

        <div>
            <Select className="select-button" options={partylist}/>
            <p>Party</p>
        </div>

        </>
    );
    function WhoKnows(e) {
            fetch("/default_data_set").then(
                res => res.json()
            ).then(
                data => {
                    setData(data)
                    console.log("default fetch run")
                    console.log(data)
                }
            )
        }
}



